function showMsg(url) {
	var pid=$('#pid').val();
	$.getJSON(url+'&id='+pid, function(data){
	   if(data.s==1){
			var str='';
			var val =data.content;
		
			switch (data.type) {
				case 'comment':
					
					var fromAccount;

					fromAccount = "user_"+strs.uid;
					str+='<li><div class="chat_left">';
				
					str+='<div class="head_portrait"><img src="'+val.headimgurl+'"></div><i class="iconfont" value="'+val.headimgurl+'">&#xe8be;</i></div><div class="chat_right"><div class="char_name">'+data.name.substr(0,5)+'<span style="display:block;color:gray;font-size:12px;">'+strs.times+'</span></div><div class="char_message">'+convertTextMsgToHtml(val.content)+'<div class="send"></div></div></div></li>';
					
					
					$("#pid").val(data.pid);
					$('.chat_title').append(str);
					break;
				case 'gift':
					$("#pid").val(data.pid);
					$('.chat_title').append('<p class="red-tishi"><i class="iconfont" value="user_'+strs.uid+'"></i>'+(val.content)+'</p>');
					scrollend();
					break;
				case 'reward':
					$("#pid").val(data.pid);
					$('.chat_title').append('<p class="red-tishi">'+(val.content)+'</p>');
					scrollend();
					break;
				case 'grouppacket':
					var fromAccount;

					fromAccount = "user_"+strs.uid;
					$("#pid").val(data.pid);
					
					if(roomadmin.indexOf('"'+fromAccount.replace('user_','')+'"')>0){
					  str+='<span class="sec"> (管理员) </span>';  
					}
					$('.chat_title').append('<li class="redbao"><div class="chat_left"><div class="head_portrait"><img src="'+val.headimgurl+'"></div><i class="iconfont" value="user_'+strs.uid+'">&#xe8be;</i></div><div class="chat_right"><div class="char_name" username="'+data.name+'">'+data.name.substr(0,5)+str+'<span style="display:block;color:gray;font-size:12px;">'+strs.times+'</span></div><div class="char_message red_message"><div class="red-red" value="'+val.id+'"><img src="../addons/wxz_wzb/template/mobile/2/image/hongbao.png" height="45px"><div class="red-cent"><p class="red-title">'+val.content+'</p><p>领取红包</p></div></div><div class="send"></div><div class="red_name">直播间红包</div></div></div></li>');
					scrollend();
					break;
				case 'shutup':
					var fromAccount;
					fromAccount = "user_"+val.touid;
					$("#pid").val(data.pid);
					$('.chat_title').append('<p class="red-tishi">'+data.name.substr(0,5)+'已被管理员禁言</p>');
	
					if(fromAccount==loginInfo.identifier){
				
						$('#send_msg_text').attr('readonly','true');
						$('#send_msg_text').attr('placeholder','您已被禁言');
					}
					scrollend();
					break;
				case 'cancelshutup':
					var fromAccount;
					fromAccount = "user_"+val.touid;
					$("#pid").val(data.pid);
					$('.chat_title').append('<p class="red-tishi">'+data.name.substr(0,5)+'已移除禁言</p>');
					if(fromAccount==loginInfo.identifier){
						$('#send_msg_text').removeAttr('readonly');
						$('#send_msg_text').attr('placeholder','和大伙说点什么吧');
					}
					scrollend();
					break;
				case 'allshutup':
					$("#pid").val(data.pid);
					if(loginInfo.isadmin!=1){
						$('#send_msg_text').attr('readonly','true');
						$('#send_msg_text').attr('placeholder','全员禁言中');   
					}
					$('.chat_title').append('<p class="red-tishi">管理员已设置全员禁言</p>');  
					scrollend();
					break;
				case 'cancelallshutup':
					$("#pid").val(data.pid);
					$('.chat_title').append('<p class="red-tishi">管理员已移除全员禁言</p>');
					$('#send_msg_text').removeAttr('readonly');
					$('#send_msg_text').attr('placeholder','和大伙说点什么吧');
					scrollend();
					break;
			}
			if ((($('.chat_title').get(0).scrollHeight-$('.chat_title').height()) - $('.chat_title').scrollTop()) < $('.chat_title').height()) {
				$('.chat_title').scrollTop($('.chat_title').get(0).scrollHeight-$('.chat_title').height());
			}
	   }
	});
}

function showPic(url) {
	var pid=$('#pid').val();
	$.getJSON(url+'&id='+pid, function(data){
	   if(data.s==1){
			var str='';
			var val =data.content;
			switch (data.type) {
				case 'pictv':
					str+='<div class="item">';
					str+='<div class="leftpng">';
					str+='<img src="'+val.images+'" width="100%"/>';
					str+='</div>';
					str+='<div class="title">';
					if(val.publisher){
						str+='<strong><span>'+val.publisher+'</span></strong>';
					}else{
						str+='<strong><span>主持人</span></strong>';
					}
					str+='<span>'+val.dateline+'</span>';
					str+='</div>';
					str+='<div class="content">';
					if(val.title){
						str +='<div align="center"><font face="黑体"><font >'+val.title+'</font></font></div>';
					}
					if(val.pics){

						$.each(val.pics,function(index,value) {
							str+='<div align="center">';
							str+='<img src="'+value+'">';
							str+='</div><br />';
						})
					}
					if(val.content){
						str +='<div align="center"><font face="黑体"><font >'+val.content+'</font></font></div>';
					}
					str+='</div>';
					str+='</div>';
			
					$("#pid").val(data.pid);
					$('#panels').prepend(str);
					break;
			}
	   }
	});

	

}
